"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Eczema (atopic dermatitis) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/eczema-atopic-dermatitis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H477851468\">",
"      <span class=\"h1\">",
"       What is eczema?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Eczema is a skin condition that makes your skin itchy and flaky. Doctors do not know what causes it. Eczema often happens in people who have allergies. Another term for eczema is &ldquo;atopic dermatitis.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H477851475\">",
"      <span class=\"h1\">",
"       What are the symptoms of eczema?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms of eczema can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Intense itching",
"       </li>",
"       <li>",
"        Redness",
"       </li>",
"       <li>",
"        Small bumps",
"       </li>",
"       <li>",
"        Skin that flakes off or forms scales (",
"        <a class=\"graphic graphic_picture graphicRef76214 \" href=\"UTD.htm?23/46/24288\">",
"         picture 1",
"        </a>",
"        )",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people with eczema have their first symptoms before they turn 5. But eczema can look different in people of different ages:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        In",
"        <strong>",
"         babies",
"        </strong>",
"        , eczema tends to affect the front of the arms and legs, cheeks, or scalp. (The diaper area is not usually affected.)",
"       </li>",
"       <li>",
"        In",
"        <strong>",
"         older children and",
"        </strong>",
"        <strong>",
"         adults",
"        </strong>",
"        , eczema often affects the back of the neck, the elbow creases, and the backs of the knees. Adults can also get it on their face, wrists, hands, and forearms.",
"       </li>",
"       <li>",
"        In",
"        <strong>",
"         older children and adults",
"        </strong>",
"        , the skin can become thick and dark. It may even forms scars from too much scratching.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H477851482\">",
"      <span class=\"h1\">",
"       Is there a test for eczema?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No, there is no test. But doctors and nurses can tell if you have eczema it by looking at your skin and by asking you questions.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H477851489\">",
"      <span class=\"h1\">",
"       What can I do to reduce my symptoms?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Use unscented thick moisturizing creams and ointments to keep the skin from getting too dry.",
"      <strong>",
"      </strong>",
"      Also, try to avoid things that can make eczema worse, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Having dry skin that has not been treated with moisturizing creams or ointments",
"       </li>",
"       <li>",
"        Being too hot or sweating too much",
"       </li>",
"       <li>",
"        Being in very dry air",
"       </li>",
"       <li>",
"        Stress or worry",
"       </li>",
"       <li>",
"        Sudden temperature changes",
"       </li>",
"       <li>",
"        Harsh soaps or cleaning products",
"       </li>",
"       <li>",
"        Perfumes",
"       </li>",
"       <li>",
"        Wool or synthetic fabrics (like polyester)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H477851496\">",
"      <span class=\"h1\">",
"       How is eczema treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are treatments that can relieve the symptoms of eczema. But the condition cannot be cured. Even so, about half of children with eczema grow out of it by the time they become adults. The treatments for eczema include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Moisturizing creams or ointments",
"        </strong>",
"        &ndash; These products help keep your skin moist. In some cases, your doctor or nurse may suggest using a moist dressing over special creams or medicines.",
"       </li>",
"       <li>",
"        <strong>",
"         Steroid creams and ointments",
"        </strong>",
"        &ndash; These medicines are different than the steroids athletes take to build muscle. They go on the skin, and they relieve itching and redness. (In severe cases, you may need steroids in pills. But your doctor or nurse will want to take you off steroid pills as soon as possible. Even though these medicines help, they can also cause problems of their own.)",
"       </li>",
"       <li>",
"        <strong>",
"         Medicines that change the way the immune system works",
"        </strong>",
"        &ndash; These medicines are only for people who do not get better with safer treatment options.",
"       </li>",
"       <li>",
"        <strong>",
"         Antihistamine pills",
"        </strong>",
"        &ndash; Antihistamines are the medicines people often take for allergies. Some people with eczema find that antihistamines relieve itching. Others do not think the medicines do any good. Many people with eczema find that itching is worst at night. That can make it hard to sleep. If you have this problem, talk with your doctor or nurse about it. He or she might recommend an antihistamine that can also help with sleep.",
"       </li>",
"       <li>",
"        <strong>",
"         Light therapy",
"        </strong>",
"        &ndash; Another treatment option is something called &ldquo;light therapy,&rdquo; but doctors do not use it much. During light therapy, your skin is exposed to a special kind of light called ultraviolet light. This therapy is usually done in a doctor&rsquo;s office.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Light therapy can help with eczema but experts worry that it might increase a person's risk for skin cancer. Doctors usually recommend it for people who do not get better with other treatments.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H477851503\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
