"     <a class=\"drug drug_patient\" href=\"UTD.htm?0/21/341?source=related_link\">",
"      Tacrolimus (topical): Patient drug information",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_pediatric\" href=\"UTD.htm?26/9/26772?source=related_link\">",
"      Tacrolimus (topical): Pediatric drug information",
