var title_f6_30_6637="Ichthyoses";
var content_f6_30_6637=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F71157&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F71157&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The ichthyoses",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Inheritance and pathogenesis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Key clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        <strong>",
"         Icthyosis vulgaris",
"        </strong>",
"       </td>",
"       <td>",
"        Autosomal dominant",
"       </td>",
"       <td rowspan=\"3\">",
"        Relatively common (1:250 to 1:300). Fine, white translucent scales predominantly on extensor surfaces of extremities with sparing of flexures, palms, soles, and face. Hyperlinear palms. Often associated with keratosis pilaris and atopy including eczema. Onset during childhood. Typically improves with age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fillagrin defect resulting in a retention hyperkeratoses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Normal epithelial turnover)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        <strong>",
"         X-linked ichthyosis (steroid sulfatase deficiency)",
"        </strong>",
"       </td>",
"       <td>",
"        X-linked recessive",
"       </td>",
"       <td rowspan=\"3\">",
"        1:6000 men. Failure to progress in labor in mother of affected fetus (placental sulfatase deficiency). Large brown \"dirty\" adherent scales with relative sparing of flexures, palms, soles, and face. Asymptomatic corneal opacities (50 percent of adult males). 12 to 15 percent incidence of cryptorchidism and independently increased risk of testicular cancer. Onset at two to six weeks. Gradually worsens with age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Steroid sulfatase deficiency results in cholesterol sulfate accumulation and a retention hyperkeratoses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Normal epithelial turnover)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        <strong>",
"         Lamellar ichthyosis",
"        </strong>",
"       </td>",
"       <td>",
"        Autosomal recessive",
"       </td>",
"       <td rowspan=\"3\">",
"        1:300,000 live births. \"Collodion baby\" at birth (translucent taut parchment-like membrane encasing infant, ectropion, eclabium, generalized erythroderma; complications include sepsis, protein loss, and electrolyte abnormalities). Children and adults develop large brown polygonal scales involving entire body surface, with increased involvement in flexural folds. Palmoplantar keratoderma, scarring alopecia, nail dystrophy, and hypohidrosis with heat intolerance frequently seen. Ectropion is also almost always present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Transglutaminase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Increased epithelial turnover)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Congenital ichthyosiform erythroderma (nonbullous congenital ichthyosis)",
"        </strong>",
"       </td>",
"       <td>",
"        Autosomal recessive",
"       </td>",
"       <td rowspan=\"2\">",
"        \"Collodion baby\" at birth (see above). Children and adults develop generalized erythroderma with fine white scaling. Palmoplantar keratoderma, scarring alopecia, and persistent ectropion may also be seen.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Increased epithelial turnover)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        <strong>",
"         Epidermolytic hyperkeratosis (bullous icthyosis)",
"        </strong>",
"       </td>",
"       <td>",
"        Autosomal dominant",
"       </td>",
"       <td rowspan=\"3\">",
"        Neonatal period with widespread blistering and erythema. Later infancy and adulthood characterized by generalized hyperkeratosis with dark scales and spiny ridges especially pronounced flexurally. Denuded areas of skin where scales shed with full thickness stratum corneum also seen. Focal bullae due to secondary infection may also develop.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        50 percent due to spontaneous mutations of keratins 1 and 10",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Increased epithelial turnover)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Harlequin fetus",
"        </strong>",
"       </td>",
"       <td>",
"        Autosomal recessive",
"       </td>",
"       <td rowspan=\"2\">",
"        Massive armor-like plates of scale with deep fissures encasing fetus. Severe ectropion, eclabium, deformed or absent ears, nose, fingers, toes. Infants are born stillborn or generally die shortly after birth due to respiratory and feeding compromise due to constriction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        (Increased epithelial turnover)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
