" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 511px\">",
"   <div class=\"ttl\">",
"    ALAS2 mutations in X-linked sideroblastic anemia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 491px; height: 459px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The location and codon change of distinct mutations identified to date in the erythroid 5-aminolevulinate synthase (ALAS2) gene in patients with X-linked sideroblastic anemia are shown here.",
"    <sup>",
"     [1-4]",
"    </sup>",
"    Two mutations found in the promoter region of the ALAS2 gene (c.-206C&gt;G; c.-91_-44del) are not indicated. Twenty-two percent of the mutations occurred in more than one unrelated proband or family; nearly one-third of the probands are female.",
"    <div class=\"footnotes\">",
"     IRE: iron responsive element; kb: kilobases.",
"     <br>",
"      * K391: pyridoxal 5'-phosphate binding lysine.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
