"       </li>",
"       <li>",
"        Ducamp S, Kannengiesser C, Touati M, et al. Sideroblastic anemia: molecular analysis of the ALAS2 gene in a series of 29 probands and functional studies of 10 missense mutations. Hum Mutat 2011; 32:590.",
"       </li>",
"       <li>",
